#include "paddle/fluid/operators/elementwise/scalar_elementwise_op.h"

namespace paddle {
namespace operators {

using framework::Tensor;

class ScalarElementwiseAddFunctor {
 public:
  void operator()(const framework::ExecutionContext &ctx) const {
    auto *out = ctx.Output<Tensor>("Out");
    auto *in = ctx.Input<Tensor>("X");
    auto scalar = ctx.Attr<float>("scalar");

    PADDLE_ENFORCE_EQ(in->numel(), 1,
                      errors::InvalidArgument("The input tensor must have "
                                                "1 element, but received:%d.",
                                                in->numel()));

    out->mutableData<float>(ctx.GetPlace());
    auto *out_data = out->data<float>();
    out_data[0] = in->data<float>()[0] + scalar;
  }
};

template <typename T>
class ScalarElementwiseAddOpKernel : public framework::OpKernel<T> {
 public:
  void Compute(const framework::ExecutionContext &ctx) const override {
    if (ctx.In<Tensor>("X")->numel() == 1) {
      ctx.Output<Tensor>("Out")->mutableData<T>(ctx.GetPlace());
      auto *out = ctx.Output<Tensor>("Out")->data<T>();
      auto *in = ctx.Input<Tensor>("X")->data<T>();
      auto scalar = ctx.Attr<T>("scalar");

      if (std::is_same<T, float>::value) {
        ScalarElementwiseAddFunctor functor;
        functor(ctx);
      } else {
        *out = (*in) + scalar;
      }
    } else {
      ScalarElementwiseAddOp<T>:: Compute(ctx);
    }
  }
};

#define DECLARE_0ARITY_KERNEL(dtype)                                      \
  class ScalarElementwiseAdd##dtype##Kernel                                  \
      : public ScalarElementwiseAddOpKernel<dtype> {                           \
   public:                                                                    \
    ScalarElementwiseAdd##dtype##Kernel(const framework::OpKernelInfo &info,   \
                                        const framework::KernelRegistry &reg)  \
        : ScalarElementwiseAddOpKernel<dtype>(info, reg) {}                    \
  };                                                                         \
  template <>                                                                \
  bool CanAddToOptimizationPass<ScalarElementwiseAdd##dtype##Kernel>() { return \
      true;  }                                                               \
  template <>                                                                \
  std::unique_ptr<framework::OpKernel<dtype>> Create##ScalarElementwiseAdd##dtype##Kernel(
      const framework::OpKernelInfo &info,                                  \
      const framework::KernelRegistry &reg) {                                \
    return std::unique_ptr<framework::OpKernel<dtype>>(new                   \
        ScalarElementwiseAdd##dtype##Kernel(info, reg));                     \
  }

DECLARE_0ARITY_KERNEL(float);
DECLARE_0ARITY_KERNEL(double);

}  // namespace operators
}  // namespace paddle

