		if (isset($_POST['sp_settings_submit'])) {
			$settings = $_POST[$this->get_base_name()];

			foreach($settings as $key => $value) {
				$updated = update_option($key, $value);
			}

			settings_errors($this->get_base_name());

			if (count($updated) > 0) {
				$this->show_settings_notice();
			}
		}
	}

	public function show_admin_notices() {
		settings_errors($this->get_base_name());
	}

}

