#include "../include/RaZ/Render/RenderSystem.h"

using namespace Raz;

namespace {

constexpr GLenum BUFFER_USAGE_DYNAMIC = GL_DYNAMIC_COPY;

} // Anonymous namespace

Ubo::Ubo(ShaderProgram& program, const std::string& name)
    : m_name(name)
    , m_program(program) {
}

Ubo::~Ubo() {
  if (m_bufferID) {
    gRenderSystem.glDeleteBuffers(1, &m_bufferID);
    m_bufferID = 0;
  }
}

bool Ubo::create() {
  if (m_bufferID) {
    Log::fatal("[Ubo] Buffer already created");
    return false;
  }

  m_bufferID = gRenderSystem.glGenBuffers(1);
  if (!m_bufferID) {
    Log::fatal("[Ubo] Failed to create buffer ID");
    return false;
  }

  return true;
}

bool Ubo::bufferData(const void* data, std::size_t size) {
  if (!m_bufferID) {
    Log::fatal("[Ubo] Buffer not created");
    return false;
  }

  if (m_bufferSize < size) {
    Log::fatal("[Ubo] Buffer too small, cannot update data");
    return false;
  }

  if (m_program.isBound()) {
    gRenderSystem.glBindBufferBase(GL_UNIFORM_BUFFER, getIndex(), m_bufferID);
  }

