    class NetBindingTest
        : public AllocatorsFixture
    {
    public:
        NetBindingTest()
            : AllocatorsFixture(GetDefaultAllocator())
        {
        }

        ~NetBindingTest() = default;

        void SetUp() override
        {
            AZ::ComponentApplication::Enable(AllocatorInstance());
        }

        void TearDown() override
        {
            AZ::AllocatorInstance<AZ::PoolAllocator>::Disable();
        }

        void CheckSucceeded()
        {
            AZ_TEST_ASSERT(m_netBinding.IsConnected());
        }

        void CheckFailed()
        {
            AZ_TEST_ASSERT(!m_netBinding.IsConnected());
        }

    protected:
        AZ::NetBinding m_netBinding;
    };

    class UniqueNetBindingTraits
        : public AZ::NetBindingTraits
    {
    public:
        UniqueNetBindingTraits()
        {
            SetVersion(AZ::NetBindingVersion::Unknown);
            SetApplicationName("Test Application");
        }

        ~UniqueNetBindingTraits()
        {
        }

        bool Compare(const AZ::NetBindingTraits& other) const override
        {
            return this == &other;
        }

        void Reflect(AZ::ReflectContext* context) override
        {
            AZ::SerializeContext* serializeContext = azrtti_cast<AZ::SerializeContext*>(context);
            if (serializeContext)
            {
                serializeContext->Class<UniqueNetBindingTraits>()
                    ->Version(1)
                    ;
            }
        }
    };

    TEST_F(NetBindingTest, ConnectionAttemptSucceeds)
    {
        AZ::MockNet_Session* session = new AZ::MockNet_Session();

        AZ::NetBinding::UniqueBinding binding(AZ::NetBindingTraits(), AZ::NetBinding::BindTo(session));

        AZ::NetBinding::Unbind(binding);
        NetBindingTest_SessionTraffic traffic;
        binding->GetTraffic(&traffic);

        EXPECT_CALL(traffic, SendMessage(_, _, _, _, _, _, _)).Times(0); // Expect no SendMessage calls to occur inside BindTo().

        EXPECT_TRUE(AZ::NetBinding::Bind(binding, session, AZ::NetBinding::ChannelId(2), [](bool succeeded) { 
            AZ_TEST_ASSERT(succeeded);
        }));

        CheckSucceeded();

        AZ::NetBinding::Unbind(binding);

        delete session;
    }

    TEST_F(NetBindingTest, ConnectionAttemptFails)
    {
        AZ::MockNet_Session* session = new AZ::MockNet_Session();
        AZ::NetBinding::UniqueBinding binding(AZ::NetBindingTraits(), AZ::NetBinding::BindTo(session));
        NetBindingTest_SessionTraffic traffic;
        binding->GetTraffic(&traffic);

        EXPECT_CALL(traffic, SendMessage(_, _, _, _, _, _, _)).WillOnce(::testing::Return(false));

        EXPECT_FALSE(AZ::NetBinding::Bind(binding, session, AZ::NetBinding::ChannelId(2), [](bool succeeded) { 
            AZ_TEST_ASSERT(!succeeded);
        }));

        CheckFailed();

        AZ::NetBinding::Unbind(binding);

        delete session;
    }

    TEST_F(NetBindingTest, ConnectionAttemptSucceedsWithUniqueTraits)
    {
        AZ::MockNet_Session* session = new AZ::MockNet_Session();

        AZ::UniqueNetBindingTraits uniqueTraits;
        uniqueTraits.SetVersion(1);
        uniqueTraits.SetApplicationName("Test Application");

        AZ::NetBinding::UniqueBinding binding(uniqueTraits.get(), AZ::NetBinding::BindTo(session));

        AZ::NetBinding::Unbind(binding);
        NetBindingTest_SessionTraffic traffic;
        binding->GetTraffic(&traffic);

        EXPECT_CALL(traffic, SendMessage(_, _, _, _, _, _, _)).Times(0); // Expect no SendMessage calls to occur inside BindTo().

        EXPECT_TRUE(AZ::NetBinding::Bind(binding, session, AZ::NetBinding::ChannelId(3), [](bool succeeded) {
            AZ_TEST_ASSERT(succeeded);
        }));

        CheckSucceeded();

        AZ::NetBinding::Unbind(binding);

        delete session;
    }

    TEST_F(NetBindingTest, ConnectionAttemptFailsWithUniqueTraits)
    {
        AZ::MockNet_Session* session = new AZ::MockNet_Session();

        AZ::UniqueNetBindingTraits uniqueTraits;
        uniqueTraits.SetVersion(1);
        uniqueTraits.SetApplicationName("Test Application");

        AZ::NetBinding::UniqueBinding binding(uniqueTraits.get(), AZ::NetBinding::BindTo(session));

        AZ::NetBinding::Unbind(binding);
        NetBindingTest_SessionTraffic traffic;
        binding->GetTraffic(&traffic);

        EXPECT_CALL(traffic, SendMessage(_, _, _, _, _, _, _)).WillOnce(::testing::Return(false));

        EXPECT_FALSE(AZ::NetBinding::Bind(binding, session, AZ::NetBinding::ChannelId(4), [](bool succeeded) {
