namespace chromeos {

class TermsOfServiceScreen::View : public views::ModalDialogDelegateView {
 public:
  View(base::WeakPtr<TermsOfServiceScreen> screen)
      : screen_(screen), weak_ptr_factory_(this) {}

  // views::ModalDialogDelegateView overrides.
  void ButtonPressed(base::WeakPtr<views::Button> sender,
                     const ui::Event& event) override {
    if (sender == accept_button_) {
      screen_->AcceptTOS();
    } else {
      screen_->OnDialogClosed(views::ModalDialogHost::ClosingReason::CANCEL);
    }
  }

  void OnEulaLinkClicked() override {
    chrome::AttemptNavigationToURL(
        Profile::FromWebUI(web_ui()), GURL("https://www.chromium.org/eula"));
  }

  void OnPrivacyPolicyLinkClicked() override {
    chrome::AttemptNavigationToURL(
        Profile::FromWebUI(web_ui()), GURL("https://www.chromium.org/privacy"));
  }

  void OnLearnMoreLinkClicked() override {
    chrome::AttemptNavigationToURL(
        Profile::FromWebUI(web_ui()), GURL("https://support.google.com/chrome_os"));
  }

  void GetAccessibleNodeData(ui::AXNodeData* node_data) override {
    // TODO(http://crbug.com/1146699): This should get the correct title from a
    // UMA.
    node_data->SetName(
        l10n_util::GetStringUTF16(IDS_TERMS_OF_SERVICE_DIALOG_ACCESSIBLE_NAME));
  }

 private:
  base::WeakPtr<TermsOfServiceScreen> screen_;

  views::LinkView eula_link_;
  views::LinkView privacy_policy_link_;
  views::LinkView learn_more_link_;

  views::CheckboxButton tos_checkbox_;
  views::Button accept_button_;
};

TermsOfServiceScreen::TermsOfServiceScreen()
    : OobeScreen(TermsOfServiceView,
                  TermsOfServiceView,
                  OobeScreenPriority::TOS_SCREEN) {}

TermsOfServiceScreen::~TermsOfServiceScreen() {}

void TermsOfServiceScreen::Show() {
  // This screen is only shown if device policy allows it.
  LOG_IF(ERROR, !Showing())
      << "TOS screen is shown multiple times.";

  // If OOBE screen is not showing yet (for example, in case of policy
  // change resulting in OOBE-reset), force the screen update.
  if (GetScreen()->should_show_splash())
    UpdateScreen(Screens::WELCOME);
  UpdateScreen(Screens::TERMS_OF_SERVICE);
}

void TermsOfServiceScreen::Hide() {
  OobeScreen::Hide();
  if (tos_screen_actctor_) {
    tos_screen_actctor_->OnTosScreenHidden();
    tos_screen_actctor_->Destroy(true);
    tos_screen_actctor_ = nullptr;
  }
}

void TermsOfServiceScreen::OnAcceptTOS() {
  if (GetScreen()->maybe_show_eula()) {
    ShowEula();
  } else {
    AcceptTOS();
  }
}

void TermsOfServiceScreen::OnBackButtonClicked() {
  if (LoginDisplayHost::default_host()) {
    LoginDisplayHost::default_host()->ExitForcedEnrollment();
    // TODO(crbug.com/1197165): The code above is currently exiting the wizard
    // instead of closing the modal window. This should be fixed.
  }
}

void TermsOfServiceScreen::OnDialogClosed(
    views::ModalDialogHost::ClosingReason reason) {
  if (GetScreen()->is_guest_mode_allowed()) {
    CreateWebUIScreen(GaiaWebUiScreen::kScreenId);
  }
}

void TermsOfServiceScreen::AcceptTOS() {
  DCHECK(tos_screen_actctor_);
  tos_screen_actctor_->OnAcceptTOS();
}

void TermsOfServiceScreen::CreateView() {
  // Create and set the view for this screen.
  View* view = new View(weak_ptr_factory_.GetWeakPtr());
  SetView(view);
}

void TermsOfServiceScreen::SetTosScreenActor(
    std::unique_ptr<TosScreenActor> tos_screen_actor) {
  tos_screen_actctor_ = std::move(tos_screen_actor);
}

void TermsOfServiceScreen::GetHelpTopics(
    base::DictionaryValue* help_topics) {
  Screens::GetHelpTopics(help_topics, IDS_TOUCH_TO_AGREE_TOS_HELP_HEADING,
                          IDS_TOUCH_TO_AGREE_TOS_HELP_TEXT);
}

void TermsOfServiceScreen::LocalizeContents() {
  // This screen is always localized in the webui.
}

}  // namespace chromeos

