\subsection{Preliminaries}

\subsubsection{Notations}
The following notations will be used throughout the paper.
\begin{itemize}
\item $f \sim g:$ $f$ and $g$ are comparable up to constants, i.e.,
$g/f$ is bounded away from zero and infinity.
\item $\mathbb{N}:= \{1,2,\ldots\}, \mathbb{N}_0:=\mathbb{N}\cup\{0\},
\mathbb{R}:= (-\infty, \infty), \mathbb{R}_+:=
[0,\infty)$.
\item For a vector $x\in \mathbb{R}^d$, $x^j$ denotes the $j$-th element.
\item For a matrix $A\in \mathbb{R}^{d\times d}$, $A_{j,k}$ or
$A^j_k$ denotes the determinant of $A$ where the $j$-th row and
$k$-th column are deleted. In particular, $A=\det A_{1,1}$.
\item The inverse of a matrix $A\in \mathbb{R}^{d\times d}$ is denoted by
$A^{-1}$.
\item A multi-index is a vector $\alpha=(\alpha_1,\alpha_2,\ldots,
\alpha_d)$, which belongs to the set $\mathbb{N}^d$ of $d$-dimensional vectors. For $\alpha\in \mathbb{N}^d$, we define $\alpha!:=\alpha_1! \alpha_2!
\cdots \alpha_d!$, $|\alpha|:=
\alpha_1+\alpha_2+\cdots+\alpha_d$, $\alpha!x^\alpha:= \prod_{i=1}^d
(x^i)^{\alpha_i}$, and $D^\alpha f:= \frac{\partial^{|\alpha|}f}
{\partial x_1^{\alpha_1}\partial x_2^{\alpha_2} \cdots
\partial x_d^{\alpha_d}}$.
\item For a vector space $V$, we denote by $\mathcal{S}(V)$
the space of Schwarz functions on $V$, i.e., the set of smooth functions on $V$
whose derivatives of all orders are rapidly decreasing.
\item For $N\in \mathbb{N}$, the set of all monomials in $\mathbb{R}^N$ of degree $\leq d$
is denoted by $\mathcal{M}_d$.
\item For a smooth function $f(\xi)$ on $\mathbb{R}^d$,
$\supp(f)=B$ if the support of $f$ is a compact subset of a ball centered at the origin with radius $B>0$.
\item For a real number $\lambda$, Re$(\lambda)$ denotes the real part of $\lambda$.
\end{itemize}

\subsubsection{Banach spaces and Sobolev spaces}
\label{Se:Banach-sobolev}
We will need various Banach spaces and Sobolev spaces. Below is a list of commonly used spaces and some of their properties.
\begin{itemize}
\item Let $U\subseteq \mathbb{R}^d$ be an open set. Then $C^\infty(U)$ is the space of smooth functions on $U$, and $ \mathcal{C}_0^\infty(U)$ is the subspace of smooth functions on $U$ with compact support in $U$.
\item $L^2(U)$ is the Hilbert space of square-integrable functions on
$U$.
\item For $s\in \mathbb{R}$, $H^s(U)$ and $\dot H^s(U)$ are the
(homogeneous) Sobolev spaces of order $s$. The former space is the completion of $C_0^\infty(U)$ with respect to the norm
\begin{align} \label{Se1:Hsnorm}
\|f\|_{H^s(U)}:
=
\|(1+|\xi|^2)^{s/2}\hat{f}\|_{L^2(\mathbb{R}^d)}.
\end{align}
The latter space is the space of tempered distributions $f$ such that $\hat{f}\in L^2(\mathbb{R}^d,(1+|\xi|^2)^sd\xi)$, equipped with the norm
$\|\cdot\|_{\dot H^s(U)}:= \|\hat{\cdot}\|_{L^2(\mathbb{R}^d,(1+|\xi|^2)^sd\xi)}$.

For $s\in (0,1)$, the spaces $H^s(U)$ and $\dot H^s(U)$ are Banach spaces, whereas for $s<0$, they are not, see \cite[Chapter 2]{Triebel2006}.
However, for $s\geq 0$, the homogeneous Besov spaces $\dot B^s_{2\infty}$ are Banach spaces that are isomorphic to $\dot H^s$.
Note also that
\begin{align} \label{Se1:H-norm}
\int_U (1+|\nabla f(x)|^2)^s dx \sim
\sum\limits_{\alpha \in \mathbb{N}^d_0, |\alpha|\leq s}
\int_U |\partial^\alpha f(x)|^2 dx,
\quad
\int_U (1+|\nabla f(x)|^2)^s dx \sim
\int_U (1+ |x|^2)^s |f(x)|^2 dx.
\end{align}
\end{itemize}

In our analysis, we need some embeddings of Sobolev spaces.
\begin{proposition}
\label{Pt:Hscont}
Let $U\subseteq \mathbb{R}^d$ be an open set, $s_1\leq s_2$, $k\in \mathbb{N}$, and $k\leq s_1$. Then the following embeddings hold:
\begin{itemize}
\item[(i)] $H^{s_2}(U)\hookrightarrow H^{s_1}(U)$ if $s_1<s_2<k+s_1$ and $H^{s_2}(U)\hookrightarrow C^k(U)$ if $s_2\geq k+s_1$.
\item[(ii)] $\dot H^{s_2}(U)\hookrightarrow \dot H^{s_1}(U)$ if $s_1<s_2<k+s_1$ and $\dot H^{s_2}(U)\hookrightarrow C^k(U)$ if $s_2\geq k+s_1$.
\item[(iii)] If $U$ is a cube or a ball with radius 1 centered at the origin, and $s_1\leq s_2<k+s_1$, then $H^{s_2}(U)\hookrightarrow C(\bar U)$ if $k\gg 1$.
\end{itemize}
\end{proposition}

We will also make use of the following interpolation inequality.
\begin{proposition}\label{Thm:interpol}
Let $U\subseteq \mathbb{R}^d$ be an open set, $0\leq s_1<s_2$, and $f\in H^{s_2}(U)$. Then
\begin{align} \label{Se1:interpol}
\|f\|_{H^{s_1}(U)}
\lesssim
\|f\|_{L^2(U)}^{1-s_2/s_1}
