const path = require('path');
const fs = require('fs');
const exec = require('child_process').execSync;

function resolve(...paths) {
  return path.resolve(...paths);
}

function rmdir(dir) {
  if (!fs.existsSync(dir)) {
    return;
  }
  if (fs.lstatSync(dir).isDirectory()) {
    const items = fs.readdirSync(dir);
    items.forEach(item => rmdir(path.resolve(dir, item)));
  }
  fs.rmdirSync(dir);
}

function removeFilesInDir(dir) {
  if (!fs.existsSync(dir)) {
    return;
  }
  if (fs.lstatSync(dir).isDirectory()) {
    const items = fs.readdirSync(dir);
    items.forEach(item => removeFilesInDir(path.resolve(dir, item)));
  } else {
    fs.unlinkSync(dir);
  }
}

function runCommand(cmd) {
  if (process.platform === 'win32') {
    cmd = cmd.replace('./', '.).\\');
  }
  exec(cmd, { stdio: 'inherit' });
}

function replaceStringInFile(filename, search, replace) {
  const fileContents = fs.readFileSync(filename, 'utf8');
  const newFileContents = fileContents.replace(search, replace);
  fs.writeFileSync(filename, newFileContents);
}

module.exports = {
  resolve,
  rmdir,
  removeFilesInDir,
  runCommand,
  replaceStringInFile,
};

