    const std::string& title = "Cookie Diagnostics";
    const std::string& no_cookie_line = "Cookie not set";
    const std::string& test_url = "http://www.a.com";

    ASSERT_TRUE(NavigateToURL(shell(), test_url));

    // Verify there are no cookies.
    std::string no_cookie_html;
    EXPECT_TRUE(ExecJs(
        shell(), JsReplace("$1.toString();", JsGetCookieWithName(
                                JsGetDocument(), JsString("cookie_name")
                                                       .ToString()))));
    EXPECT_TRUE(
        ExecJs(shell(), JsReplace("window.domAutomationController.send(0 === $1);",
                                    JsGetCookieWithName(JsGetDocument(),
                                                         JsString("cookie_name")))));
    EXPECT_TRUE(ExecuteScriptAndExtractString(
        shell(), JsReplace("window.domAutomationController.send("
                             "$1.querySelectorAll('pre').children.length == 0);",
                             JsGetByTagName("pre").querySelectorAll(
                                 ".cookie-diagnostics-line.no-cookie-set")),
