                        JsReplace("""
                                   document.cookie = 'cookie_name=cookie_value; '
                                   + 'expires=Thu, 31 Dec 2099 23:59:59 UTC; '
                                   + 'path=/; '
                                   + '${http_only ? "HttpOnly" : ""}';
                                  """,
                                  enable_http_only)));

