#include "config.h"
#ifdef HAVE_LIBNETAPI
#include <netapi.h>
#include "common.h"
#include "netapi.h"

/******************************************************************************
 * GetLocalGroupMembers
 *
 *****************************************************************************/

NET_API_STATUS
GetLocalGroupMembers(
    PCSTR pszGroup,        /* [IN] */
    DWORD anLevel,          /* [IN] */
    LPBYTE *ppBuffer,        /* [OUT] */
    LPDWORD pnEntriesRead,   /* [OUT] */
    LPDWORD pnTotalEntries)  /* [OUT] */
{
    NET_API_STATUS nStatus = NERR_Success;
    PGROUP_MEMBER_INFO pInfo = NULL;
    PGROUP_MEMBER_INFO pPrevInfo = NULL;
    PGROUP_MEMBER_INFO pFirstInfo = NULL;
    DWORD nTmpBuffSize;
    PSTR pszNetbiosDomain = NULL;
    PWSTR pwszDnsDomain = NULL;
    PSTR pszServer = NULL;
    PSTR pszUsername = NULL;
    PSTR pszPassword = NULL;
    DWORD dwScope = 0;
    DWORD dwLastError = ERROR_SUCCESS;

    if (!ppBuffer) {
        SET_LAST_ERROR(NULL, ERROR_INVALID_PARAMETER);
        goto end;
    }

    /* Make sure a valid group name is being requested */
    if (!pszGroup) {
        SET_LAST_ERROR(NULL, ERROR_INVALID_PARAMETER);
        goto end;
    }

    /* Fill the buffer size with the amount of data required */
    nTmpBuffSize = 0;
    switch (anLevel) {
    case 2:
        dwScope = DS_SCOPE_SUBTREE;
        nTmpBuffSize = sizeof(GROUP_MEMBER_INFO_2);
        break;
    case 3:
        dwScope = DS_SCOPE_SUBTREE;
        nTmpBuffSize = sizeof(GROUP_MEMBER_INFO_3);
        break;
    default:
        SET_LAST_ERROR(NULL, ERROR_INVALID_LEVEL);
        goto end;
    }
    *ppBuffer = NULL;

    pszNetbiosDomain = getenv("USERDOMAIN");
    pwszDnsDomain = getenv("USERDNSDOMAIN");
    pszUsername = getenv("USERNAME");
    pszPassword = getenv("PASSWORD");
    pszServer = getenv("COMPUTERNAME");

    if (!pszNetbiosDomain || !pszServer || !pszUsername) {
        SET_LAST_ERROR(NULL, ERROR_NOT_ENOUGH_MEMORY);
        goto end;
    }

    if (NET_API_STATUS_SUCCESS !=
        (nStatus = NetGroupGetMembers(pszServer, pszNetbiosDomain, pszGroup, anLevel, ppBuffer,
                                        &nTmpBuffSize, pnEntriesRead, pnTotalEntries, &dwScope))) {
        if ((nStatus != ERROR_INSUFFICIENT_BUFFER) ||
            (NET_API_STATUS_SUCCESS !=
             (nStatus = NetGroupGetMembers(pszServer, pszNetbiosDomain, pszGroup, anLevel, ppBuffer,
                                            nTmpBuffSize, pnEntriesRead, pnTotalEntries, &dwScope)))) {
            dwLastError = ERROR_INTERNAL_ERROR; // TODO: more specific.
            goto end;
        }
    }

    pInfo = *ppBuffer;
    pFirstInfo = pInfo;

    /* Loop through the returned data */
    while (nTmpBuffSize) {
        if (*pnEntriesRead >= (*pnTotalEntries)) {
            break;
        }

        if (anLevel == 2) {
            NetpPrintf("Netbios Name: %s\n", pInfo->grpi2_name);
            NetpPrintf("Comment: %s\n", pInfo->grpi2_comment);
        } else if (anLevel == 3) {
            NetpPrintf("SID: %S\n", pInfo->grpi3_sid);
            NetpPrintf("Netbios name: %s\n", pInfo->grpi3_name);
            NetpPrintf("Comment: %s\n", pInfo->grpi3_comment);
        } else {
            NetpPrintf("Error: Invalid information level specified\n");
        }

        nTmpBuffSize -= sizeof(GROUP_MEMBER_INFO_3);
        pPrevInfo = pInfo;
        pInfo = (PGROUP_MEMBER_INFO)((PBYTE)pInfo + sizeof(GROUP_MEMBER_INFO_3));

        /*
         * If we're done, make sure we zero out the next entry pointer
         * in the previous entry. This is necessary since the first entry
         * doesn't have one and it may trip up other consumers.
         */
        if (!nTmpBuffSize) {
            pPrevInfo->grpi3_next_entry_offset = 0;
            NetpPrintf("Total entries read: %lu\n", *pnEntriesRead);
            NetpPrintf("Total entries in domain: %lu\n", *pnTotalEntries);
        }
    }

end:

    if (dwLastError != ERROR_SUCCESS) {
        SET_LAST_ERROR(NULL, dwLastError);
    }

    if (pFirstInfo) {
        NetApiBufferFree(pFirstInfo);
    }
    return nStatus;
}

#endif

